import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, NavLink } from "react-router-dom";
import { FaBars, FaTimes, FaLinkedin, FaGithub, FaInstagram } from "react-icons/fa";
import Portfolio from "./Portfolio";
import About from "./About";
import Services from "./Services";
import Works from "./Works";
import Blog from "./Blog";
import Contact from "./Contact";

const navigationItems = [
  { name: "Home", path: "/" },
  { name: "About", path: "/about" },
  { name: "Services", path: "/services" },
  { name: "Works", path: "/works" },
  { name: "Blog", path: "/blog" },
  { name: "Contact", path: "/contact" },
];

const socialLinks = [
  { icon: <FaLinkedin size={20} />, href: "https://www.linkedin.com/in/imchiranjeevi", label: "LinkedIn" },
  { icon: <FaGithub size={20} />, href: "https://github.com/your-profile", label: "GitHub" }, // Update with your GitHub
  { icon: <FaInstagram size={20} />, href: "https://www.instagram.com/_imchiranjeevi", label: "Instagram" },
];

export default function App() {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  const toggleMenu = () => setIsMenuOpen(!isMenuOpen);

  return (
    <Router>
      <div className="min-h-screen bg-gray-100 text-gray-900 flex flex-col">
        {/* Navbar (Sidebar) */}
        <aside
          className={`fixed top-0 left-0 w-72 h-full bg-white text-gray-800 p-6 shadow-lg transform transition-transform duration-300 ease-in-out z-50
            ${isMenuOpen ? "translate-x-0" : "-translate-x-full"} md:translate-x-0 md:static md:w-64 md:border-r md:border-gray-200`}
        >
          <div className="flex items-center justify-between mb-8">
            <h1 className="text-xl font-semibold text-gray-900">Chiranjeevi Kumar</h1>
            <button className="md:hidden text-gray-600 hover:text-gray-800" onClick={toggleMenu}>
              <FaTimes size={20} />
            </button>
          </div>
          <nav className="space-y-2">
            {navigationItems.map((item) => (
              <NavLink
                key={item.name}
                to={item.path}
                end={item.path === "/"}
                onClick={() => setIsMenuOpen(false)}
                className={({ isActive }) =>
                  `flex items-center gap-3 px-4 py-2 rounded-lg text-sm font-medium transition-all duration-200 ${
                    isActive
                      ? "bg-green-100 text-green-700 font-semibold"
                      : "text-gray-600 hover:bg-gray-100 hover:text-gray-900"
                  }`
                }
              >
                <span className="w-1 h-5 rounded-full bg-green-500 opacity-0 group-hover:opacity-100 transition-opacity" />
                {item.name}
              </NavLink>
            ))}
          </nav>
          <div className="absolute bottom-6 left-6 right-6">
            <div className="flex gap-4 mb-4">
              {socialLinks.map((link, index) => (
                <a
                  key={index}
                  href={link.href}
                  target="_blank"
                  rel="noopener noreferrer"
                  className="text-gray-500 hover:text-green-600 transition-colors duration-200"
                  aria-label={link.label}
                >
                  {link.icon}
                </a>
              ))}
            </div>
            <p className="text-gray-400 text-xs">
              © {new Date().getFullYear()} Chiranjeevi Kumar. All rights reserved.
            </p>
          </div>
        </aside>

        {/* Mobile Hamburger Button */}
        <button
          className="fixed top-4 left-4 z-50 md:hidden p-2 bg-white rounded-lg shadow-md text-gray-600 hover:bg-gray-100 transition-colors"
          onClick={toggleMenu}
          aria-label="Toggle navigation"
        >
          {isMenuOpen ? <FaTimes size={20} /> : <FaBars size={20} />}
        </button>

        {/* Overlay for Mobile Menu */}
        {isMenuOpen && (
          <div
            className="fixed inset-0 bg-black bg-opacity-40 z-40 md:hidden"
            onClick={toggleMenu}
          />
        )}

        {/* Main Content */}
        <main className="flex-1 md:ml-64 p-4 sm:p-6 md:p-8 lg:p-12 xl:p-16 overflow-y-auto bg-gray-50">
          <Routes>
            <Route path="/" element={<Portfolio />} />
            <Route path="/about" element={<About />} />
            <Route path="/services" element={<Services />} />
            <Route path="/works" element={<Works />} />
            <Route path="/blog" element={<Blog />} />
            <Route path="/contact" element={<Contact />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}
